selector_to_html = {"a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p>To design a state-feedback controller <span class=\"math notranslate nohighlight\">\\(u = - L x + \\ell_0 r\\)</span>, we first need to check the  controllability of the system</p>", "a[href=\"#equation-eq-lec6-ex3-sol-desired-poly\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec6-ex3-sol-desired-poly\">\n\\[\n\\varphi^{\\star}(\\lambda) = (\\lambda+4)^2 = \\lambda^2 + 8 \\lambda +16\n\\]</div>", "a[href=\"#fig-lec6-ex3-sol-block\"]": "<figure class=\"align-default\" id=\"fig-lec6-ex3-sol-block\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex3-block1.svg\"><img alt=\"../_images/ex3-block1.svg\" src=\"../_images/ex3-block1.svg\" style=\"width: 600px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 59 </span><span class=\"caption-text\">Block diagram of the system</span><a class=\"headerlink\" href=\"#fig-lec6-ex3-sol-block\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>Remembering that <span class=\"math notranslate nohighlight\">\\(s X(s)\\)</span> is equivalent to the derivative in the time domain, we can write</p><p><span class=\"math notranslate nohighlight\">\\(\nX_1(s) = \\frac{1}{s+1} U(s) \\quad \\rightarrow \\quad (s+1) X_1(s) = U(s) \\quad \\rightarrow \\quad \\dot{x}_1(t) + x_1(t) = u(t) \n\\)</span></p>", "a[href=\"#solutions-of-exercise-6-3\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 6.3<a class=\"headerlink\" href=\"#solutions-of-exercise-6-3\" title=\"Link to this heading\">#</a></h1><p>Consider the system in <a class=\"reference internal\" href=\"#fig-lec6-ex3-sol-block\"><span class=\"std std-numref\">Fig. 59</span></a>.</p>", "a[href=\"#equation-eq-lec6-ex3-sol-poly\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec6-ex3-sol-poly\">\n\\[\\begin{split}\n\\begin{aligned}\n    \\varphi(\\lambda) &amp;= \\det(\\lambda I - (A - BL)) = \\det\\left( \\begin{bmatrix} \\lambda &amp; 0 \\\\ 0 &amp; \\lambda \\end{bmatrix} - \\begin{bmatrix} -1 &amp; 0 \\\\ 1 &amp; -3 \\end{bmatrix} + \\begin{bmatrix} 1  \\\\ 1 \\end{bmatrix} \\begin{bmatrix} \\ell_1 &amp; \\ell_2 \\end{bmatrix}\\right) \\\\\n    &amp;= \\det \\begin{bmatrix} \\lambda + 1 + \\ell_1 &amp; \\ell_2 \\\\ \\ell_1 - 1 &amp; \\lambda + 3 + \\ell_2 \\end{bmatrix} \\\\\n    &amp;= (\\lambda + 1 + \\ell_1) \\cdot (\\lambda + 3 + \\ell_2 ) - \\ell_2 (\\ell_1 - 1) \\\\\n    &amp;= \\lambda^2 + (4 + \\ell_1 + \\ell_2) \\lambda + 3 + 3 \\ell_1 + 2 \\ell_2\n\\end{aligned}\n\\end{split}\\]</div>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>Remembering that <span class=\"math notranslate nohighlight\">\\(s X(s)\\)</span> is equivalent to the derivative in the time domain, we can write</p><p><span class=\"math notranslate nohighlight\">\\(\nX_1(s) = \\frac{1}{s+1} U(s) \\quad \\rightarrow \\quad (s+1) X_1(s) = U(s) \\quad \\rightarrow \\quad \\dot{x}_1(t) + x_1(t) = u(t) \n\\)</span></p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
